import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { TransactionsComponent } from './transactions.component';



@NgModule({
  declarations: [
    TransactionsComponent
  ],
  exports: [
    TransactionsComponent
  ],
  imports: [
    CommonModule,
    htt
  ]
})
export class TransactionsModule { }
